SELECT *
,	RW	=	ROW_NUMBER() OVER(PARTITION BY CPF ORDER BY MAIOR_DATA DESC)
INTO #ANDREWS
FROM #TESTE1


DELETE FROM #ANDREWS WHERE RW > 1;
ALTER TABLE #ANDREWS DROP COLUMN RW;


